import moment from 'moment';
import React from 'react'


interface IDataHeader{
    name?: string,
    TActual: number,
    TPlan: number
}


const CustomizedAccordiongsHeader = (props:{data: IDataHeader})  => 
{
    const {
        name,
        TActual,
        TPlan} = props.data;


    let timeTActual = moment.unix(TActual as number).utc().format('H:m:s')
    let timeTPlan = moment.unix(TPlan as number).utc().format('H:m:s')



    return (
        <div style={{display: 'grid', gridTemplateColumns: '100px auto'}}>
                <p>{name}</p>
                <div style={{display: 'grid', gridTemplateColumns: '1fr 1fr'}}>
                  <div style={{display: 'flex', justifyContent:'space-around'}} >
                    <p>Актуальное вермя</p>
                    <p>{timeTActual}</p>
                  </div>
                  <div style={{display: 'flex', justifyContent:'space-around'}} >
                    <p>Плановое время</p>
                    <p>{timeTPlan}</p>
                  </div>
                </div>
        </div>
    )
}


export default CustomizedAccordiongsHeader;
